import MainNavigation from "../Components/MainNavigation";


const Error = () => {
    return (
        <>
            <MainNavigation />
            <main>
                <h1>An error occured</h1>
                <p>Couldnt found the page!</p>
            </main>
        </>
    );
}

export default Error;
